import classes from './AvailableMeals.module.css';
import Card from '../UI/Card';
const MENU = [
    {
      id: 'm1',
      name: 'Chicken Kebab',
      description: 'Fresh Chicken and veggies',
      price: 6900,
    },
    {
      id: 'm2',
      name: 'Somun Chicken',
      description: 'Big bread with veggies',
      price: 8900,
    },
    {
      id: 'm3',
      name: 'Chicken Rice Plate',
      description: 'Chicken, rice and veggies',
      price: 9900,
    },
    {
      id: 'm4',
      name: 'Chicken Box',
      description: 'Chicken, rice and potatos',
      price: 7900,
    },
  ];

const AvailableMeals = () => {

    const mealsList = MENU.map(meal => <li>{meal.name}</li>);
    return(
        <section className={classes.meals}>
            <Card>
            <ul>{mealsList}</ul>
            </Card>
        </section>
    );
};

export default AvailableMeals;
